import React, {Component, Fragment} from 'react';

function testComponent(props) {
    console.log(props.children);
    return (
        <div>
            <h1>Children</h1>
        </div>);
}


class AppContainer extends Component {

    constructor(props) {
        super(props);
    }

    render() {

        return (
            <testComponent>
                <h1>1</h1>
                <h1>1</h1>
                <h1>1</h1>
                <h1>1</h1>
                <h1>1</h1>
            </testComponent>
        )
    }
}


export default AppContainer;
